import { Img } from '../../UI/Img/Img'
import { UL } from '../../UI/UL/UL.JSX'
L

export const Card = ({imgUrl, styleImg, content}) => {
    return (
    <div className='card'>
        <h3>{content}</h3>
        <hr />
        <Img styleImg={styleImg} url={imgUrl} />
        


    </div>
    )
}
